import React from 'react';

const List = (props) => {
    return (
        <>
            
            <li className="list-group-item list-group-item-action" >
                
                {props.listvalue}

                <button className="material-symbols-outlined btn btn-primary button">delete</button> 
                <span className='listindex'>{props.showindex}.</span>   
            </li>
            
        </>
    );
}
export default List;
